import React, { useState } from "react";

function MyCourses() {
  const [courseList, setCourseList] = useState([
    [
      { cName: "Project Management 1", cCode: "Pr111", id: 1 },
      { cName: "C++ Programming Fundamentals", cCode: "C++111", id: 2 },
      { cName: "Computer Maintenance", cCode: "CompM1111", id: 3 },
      { cName: "Information Security 1", cCode: "IS1111", id: 4 },
    ],
    [
      { cName: "Networking", cCode: "Net222", id: 1 },
      { cName: "Web Technology", cCode: "Web222", id: 2 },
      { cName: "Project Management 2", cCode: "Pro222", id: 3 },
      { cName: "Information Security 1", cCode: "IS1111", id: 4 },
    ],
  ]);

  return (
    <div>
      <h1>My Courses</h1>
    </div>
  );
}

export default MyCourses;
